import logo from "./logo.svg";
import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";
import User from "./user";
import "./App.css";

class App extends Component {
  state = {
    user: {}
  };

  render() {
    const {user}=this.state;
    return (
      <div className="App">
        <User user={user} />
      </div>
    );
  }
}

export default App;
